<script type="text/javascript">
var question = [{q:'你老公是谁?(名字)',a:'李安'},
				{q:'李安是你的什么人?(身份)',a:'老公'},
				{q:'我的农历生日?(格式:1月1日)',a:'7月5日'},
				{q:'在一起的纪念日是?(格式:1月1日)',a:'5月13日'},
				{q:'第一次见面的日子?(格式:1月1日)',a:'10月8日'},
				{q:'我的星座?(格式:射手座)',a:'狮子座'},
				{q:'我的血型?(格式:A型)',a:'B型'},
				{q:'你爱谁?(名字)',a:'李安'},
				{q:'你喜欢谁?(名字)',a:'李安'},
				{q:'你要嫁给谁?(名字)',a:'李安'},
				{q:'我家乡在哪里?(城市)',a:'宜宾'},
				{q:'选出一项我最喜欢吃的水果?(香蕉,草莓,李子)',a:'李子'},
				{q:'选出一项我最喜欢的运动?(跑步,游泳,骑行)',a:'游泳'},
				{q:'选出一项我最讨厌的事情?(吵架,学习,上班)',a:'吵架'}
				]
</script>

<script type="text/javascript">
var nddata=[data0,data1,data2,data3,data4];

function storeTM() {
	var tm = '';
	var arr = '';
	for (i = 1; i <= 81; i++) {
		if (document.getElementById('s' + i).value.length == 1) {
			arr += document.getElementById('s' + i).value
		} else {
			arr += '0'
		}
	};
	localStorage.tm = arr;
}
function loadTM() {
	drawsudoku(localStorage.tm);
}

function drawsudoku(tm) {
	var tm0;
	for (i = 1; i <= 81; i++) {
		tm0 = tm.substring(i - 1, i);
		if (tm0 == '0') {
			document.getElementById('s' + i).value = '';
			document.getElementById('s' + i).className = 'big';
			document.getElementById('s' + i).onkeyup = function () {
				p()
			};
			document.getElementById('s' + i).setAttribute('maxLength', '5');
			document.getElementById('s' + i).readOnly = false;
			//document.getElementById('s'+i).onmouseover=function(){this.focus()};
		} else {
			document.getElementById('s' + i).value = tm0;
			document.getElementById('s' + i).className = 'fix';
			document.getElementById('s' + i).readOnly = true;
		}
	};
}
function newGame(nd) {
	if(typeof(nd) != "undefined")
		document.getElementById('nd').value = nd;
	var index = document.getElementById('nd').value;
	document.getElementById('dabk').style.display="none";
	var tmda = nddata[index][Math.floor(Math.random()*nddata[index].length)];
	document.getElementById('tm').value = tmda.substring(0,81);
	document.getElementById('da').value = tmda.substring(82);
	resetsudoku();
}
function resetsudoku() {
	drawsudoku(document.getElementById('tm').value);
	ms(document.getElementById('sel').value);
}

function check(show) {
	var tm0;
	var tm;
	var da;
	var haserror;
	//ms("X");
	da = document.getElementById('da').value;
	tm = "";
	haserror = 0;
	for (i = 1; i <= 81; i++) {
		tm0 = document.getElementById('s' + i).value;
		tm = tm + tm0;
		if (tm0.length > 1) {
			document.getElementById('s' + i).className = "cad";
		} else
			if ((da.substring(i - 1, i) != tm0) && (tm0.length == 1)) {
				document.getElementById('s' + i).className = "err";
				haserror = 1;
			} else
				if (document.getElementById('s' + i).className != "fix") {
					document.getElementById('s' + i).className = "big";
				}
	}
	if (tm == da) {
		alert("宝贝已经成功的解答了这道数独难题,真棒么么哒~");
	}else if(haserror == 0 && show != false){
		alert("到目前为止都没有问题哟~加油!!!");
	}
	return haserror;
}

function showsAnswer() {
	if(document.getElementById('dabk').style.display=="none"){
		var qa = question[Math.floor(Math.random()*question.length)];
		var person=prompt(qa.q);
		if (person!=null && person == qa.a)
		{
			alert("老公爱你么么哒~");
			document.getElementById('dabk').style.display="";
			var da = document.getElementById('da').value;
			var tm0;
			for (i = 1; i <= 81; i++) {
				tm0 = da.substring(i - 1, i);
				document.getElementById('d' + i).value = tm0;
				document.getElementById('d' + i).className = 'fix';
				document.getElementById('d' + i).readOnly = true;
			}
		}else{
			alert("呵呵,你不是我的宝贝,不给看答案!");
		}
	}else{
		document.getElementById('dabk').style.display="none";
	}
}

function strxj(sour, str) {
	var result;
	result = sour.replace(str, "");
	return (result);
}
function xt(n1, n2) {
	var jg;
	jg = false;
	if ((n1 - 1) % 9 == (n2 - 1) % 9) {
		jg = true
	}
	if (Math.floor((n1 - 1) / 9) == Math.floor((n2 - 1) / 9)) {
		jg = true
	}
	if ((Math.floor((n1 - 1) / 27) == Math.floor((n2 - 1) / 27)) && (Math.floor((n1 - 1) % 9 / 3) == Math.floor((n2 - 1) % 9 / 3))) {
		jg = true
	}
	return (jg);
}

function setcad() {
	var sel = document.getElementById('sel').value;
	if(check(false)!=0)
		return;
	for (i = 1; i <= 81; i++) {
		if (document.getElementById('s' + i).value.length !=1) {
			document.getElementById('s' + i).value = "123456789"
		}
	}
	for (i = 1; i <= 81; i++) {
		if (document.getElementById('s' + i).value.length == 1) {
			for (j = 1; j <= 81; j++) {
				if ((i != j) && (document.getElementById('s' + j).value.length != 1) && (xt(i, j))) {
					document.getElementById('s' + j).value = strxj(document.getElementById('s' + j).value, document.getElementById('s' + i).value)
						if (document.getElementById('s' + j).value.length > 1)
							document.getElementById('s' + j).className = "cad";
						if (document.getElementById('s' + j).value.length == 1)
							document.getElementById('s' + j).className = "big";
				}
			}
		}
	}
	ms(sel);
}
function p() {
	for (i = 1; i <= 81; i++) {
		var tm = document.getElementById('s' + i).value;
		if (tm.length > 1) {
			document.getElementById('s' + i).className = "cad"
		} else
			if ((document.getElementById('s' + i).className != "fix") && (document.getElementById('s' + i).className != "fix2")) {
				document.getElementById('s' + i).className = "big"
			}
	};
	ms(document.getElementById('sel').value);
}
function ms(value) {
	document.getElementById('sel').value = value;
	for (i = 1; i <= 10; i++) {
		document.getElementById('N' + i).className = 'numsel';
	}
	for (i = 1; i <= 81; i++) {
		ctm = document.getElementById('s' + i).value;
		cname = document.getElementById('s' + i).className;
		if ((ctm == value) && (cname == "fix")) {
			document.getElementById('s' + i).className = "fix2"
		};
		if ((ctm == value) && (cname == "big")) {
			document.getElementById('s' + i).className = "big2"
		};
		if ((ctm == value) && (cname == "err")) {
			document.getElementById('s' + i).className = "big2"
		};
		if ((ctm != value) && (cname == "fix2")) {
			document.getElementById('s' + i).className = "fix"
		};
		if ((ctm != value) && (cname == "big2")) {
			document.getElementById('s' + i).className = "big"
		};
		if ((ctm != value) && (cname == "err")) {
			document.getElementById('s' + i).className = "big"
		};
	}
	switch (value) {
	case 'X':
		document.getElementById('N10').className = 'numsel2';
		break
	default:
		document.getElementById('N' + value).className = 'numsel2';
	}
}
</script>
